import { useState } from 'react';
import Graph from './components/Graph';
import './App.css';
import FileUpload from "./components/FileUpload";


const data = [['"Month"', ' "1958"', ' "1959"', ' "1960"']
, ['"JAN"', '  340', '  360', '  417']
,['"FEB"', '  318', '  342', '  391']
, ['"MAR"', '  362', '  406', '  419']
, ['"APR"', '  348', '  396', '  461']
, ['"MAY"', '  363', '  420', '  472']
, ['"JUN"', '  435', '  472', '  535']
, ['"JUL"', '  491', '  548', '  622']
, ['"AUG"', '  505', '  559', '  606']
, ['"SEP"', '  404', '  463', '  508']
, ['"OCT"', '  359', '  407', '  461']
, ['"NOV"', '  310', '  362', '  390']
, ['"DEC"', '  337', '  405', '  432']]

function App() {

  const [chartData, setChartData] = useState(data);

  return (
    <div >
    <h1>CHARTIT </h1>
      <FileUpload changeState={setChartData}/>
      <Graph chartdata={chartData}/>
    </div>
  );
}

export default App;
